import ItemLink from "../shared/components/ItemLink"
import { createUseStyles } from "react-jss";

const HeaderBottom = () => {
    const navigationList = [
        {
            href: "link",
            content: "Главная",
            key: "12-1"
        },
        {
            href: "link",
            content: "Компания",
            key: "12-2"
        },
        {
            href: "link",
            content: "Каталог",
            key: "12-3"
        },
        {
            href: "link",
            content: "Новости",
            key: "12-4"
        },
        {
            href: "link",
            content: "Спецпредложения",
            key: "12-5"
        },
        {
            href: "link",
            content: "Доставка",
            key: "12-6"
        },
        {
            href: "link",
            content: "Контакты",
            key: "12-7"
        },
    ]

    const styles = createUseStyles({
        bottom: {
            paddingBottom: "54px"
        }
    });

    const classes = styles()

    return (
        <div className={classes.bottom}>
            <nav className="header-bottom__navigation">
                <ul className="navigation__list">
                    {navigationList.map((item) => <ItemLink className={"navigation-list__item"} href={item.href} content={item.content} key={item.key}></ItemLink>)}
                </ul>
            </nav>
        </div>
    )
}

export default HeaderBottom
